import React from 'react';
import { Button, Card } from 'react-bootstrap';
import { FaHeartbeat, FaMobileAlt, FaMoneyBillWave, FaPhone } from 'react-icons/fa';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';

// Features Data
const features = [
  { icon: FaHeartbeat, title: "Predictive Analytics", desc: "We predict COPD exacerbations by monitoring SpO2 levels, respiratory rate, and activity trends, while hypertension spikes are detected using HRV, heart rate patterns, and stress data. Models such as LSTM, Random Forest, etc., analyze these inputs to provide timely risk alerts and actionable insights." },
  { icon: FaMobileAlt, title: "Emergency Alerts", desc: "Our device continuously monitors your vital signs, such as heart rate, SpO2, and respiratory rate. In case of a serious health issue, it instantly sends an alert to your emergency contact and nearby hospitals, providing real-time health data to ensure timely assistance." },
  { icon: FaMoneyBillWave, title: "Personalized Care Plans", desc: "Our app generates real-time electronic health reports, tracking vital signs like heart rate and SpO2. This unique feature helps doctors in India make accurate diagnoses and provide personalized treatments, improving overall care and effectiveness." }
];

// Inline CSS
const styles = {
  body: {
    fontFamily: "'Arial', sans-serif",
    lineHeight: 1.6,
    backgroundColor: '#121212',
    color: '#e0e0e0',
  },
  section: {
    padding: '4rem 1rem',
    margin: '2rem 0',
    borderRadius: '8px',
  },
  hero: {
    textAlign: 'center',
    padding: '5rem 1rem',
    background: 'linear-gradient(to right, #222222, #444444)',
    color: 'white',
    borderRadius: '8px',
  },
  heroH1: {
    fontSize: '3.5rem',
    opacity: 0,
    animation: 'fadeIn 2s forwards',
  },
  heroLead: {
    marginTop: '1rem',
    fontSize: '1.25rem',
  },
  heroBtn: {
    marginTop: '2rem',
    padding: '0.75rem 1.5rem',
    fontSize: '1.25rem',
    backgroundColor: '#1e88e5',
    borderColor: '#1e88e5',
  },
  sectionTitle: {
    marginBottom: '1.5rem',
  },
  card: {
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.3)',
    border: 'none',
    backgroundColor: '#333',
    color: '#e0e0e0',
  },
  cardTitle: {
    fontSize: '1.5rem',
    marginTop: '1rem',
  },
  cardText: {
    fontSize: '1rem',
  },
  pricing: {
    textAlign: 'center',
    backgroundColor: '#1f1f1f',
    color: '#e0e0e0',
  },
  pricingH2: {
    fontWeight: 'bold',
    marginBottom: '1.5rem',
  },
  pricingLead: {
    fontSize: '1.25rem',
  },
  pricingBtn: {
    marginTop: '2rem',
    padding: '0.75rem 1.5rem',
    fontSize: '1.25rem',
    backgroundColor: '#1e88e5',
    borderColor: '#1e88e5',
  },
  contact: {
    textAlign: 'center',
    backgroundColor: '#222',
    color: '#e0e0e0',
  },
  contactH2: {
    fontWeight: 'bold',
    marginBottom: '1.5rem',
  },
  contactPhone: {
    fontSize: '2rem',
    color: '#1e88e5',
  },
  mt4: {
    marginTop: '1.5rem !important',
  },
  fadeIn: {
    '@keyframes fadeIn': {
      to: {
        opacity: 1,
      },
    },
  },
};

const HomePage = () => {
  return (
    <div style={styles.body}>
      {/* Vision and Mission Section */}
      <section style={{ ...styles.section, ...styles.hero }}>
        <motion.h1 className="display-4" style={styles.heroH1} initial={{ opacity: 0 }} animate={{ opacity: 1 }}>
          Welcome to sensAIra
        </motion.h1>
        <p className="lead" style={styles.heroLead}>AI-powered wearable for proactive health monitoring</p>
        <Button variant="light" className="mt-4" style={styles.heroBtn}>
          <Link to="/product" style={{ color: 'inherit', textDecoration: 'none' }}>Learn More About Our Product</Link>
        </Button>
      </section>

      {/* Problem and Solution Section */}
      <section style={{ ...styles.section, backgroundColor: '#1e1e1e' }}>
        <h2 style={styles.sectionTitle}>Our Vision and Mission</h2>
        <p><strong>Vision:</strong> To improve the quality of life for people.</p>
        <p><strong>Mission:</strong> We aim to use AI and remote monitoring technologies to provide personalized healthcare for the elderly, ensuring early warnings, continuous monitoring, and making healthcare accessible and effective.</p>

        <h3 style={styles.sectionTitle}>Problem Statement</h3>
        <p>The world's aging population is growing rapidly, but healthcare services are often inaccessible, costly, or inefficient for the elderly. 70% of seniors have at least one chronic condition, and 40% have two or more.</p>

        <h3 style={styles.sectionTitle}>Health Stats</h3>
        <ul>
          <li>41.9% of adults aged 45 and over are hypertensive.</li>
          <li>9.5% of total deaths in India are caused by COPD.</li>
          <li>55 million patients of COPD in India.</li>
        </ul>
      </section>

      {/* Features Section */}
      <section className="features" style={{ ...styles.section, backgroundColor: '#2e2e2e' }}>
        <h2 style={styles.sectionTitle}>Key Features</h2>
        <div className="row">
          {features.map((feature, idx) => (
            <div className="col-md-4 mb-4" key={idx}>
              <Card className="shadow-lg" style={styles.card}>
                <Card.Body>
                  <feature.icon className="text-primary mb-3" style={{ fontSize: '2.5rem' }} />
                  <Card.Title style={styles.cardTitle}>{feature.title}</Card.Title>
                  <Card.Text style={styles.cardText}>{feature.desc}</Card.Text>
                </Card.Body>
              </Card>
            </div>
          ))}
        </div>
      </section>

      {/* CTA Section */}
      <section className="pricing" style={{ ...styles.section, ...styles.pricing }}>
        <h2 className="font-weight-bold" style={styles.pricingH2}>Simple, Transparent Pricing</h2>
        <p className="lead" style={styles.pricingLead}>₹1999 upfront + ₹99/month after 3 months</p>
        <Button variant="primary" className="mt-4" style={styles.pricingBtn}>Buy Now</Button>
      </section>

      {/* Contact Section */}
      <section className="contact" style={{ ...styles.section, ...styles.contact }}>
        <h2 className="font-weight-bold" style={styles.contactH2}>Get in Touch</h2>
        <div>
          <FaPhone style={styles.contactPhone} />
          <span className="ml-2">+91 98765 43210</span>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
